import React from "react";
import "./footer.css";

const Footer = ()=>{
    return (
        <>
        <footer className="footer">
        <p className="footer_elem"> 2022 <div className="cir">C</div> Laundry</p>
        </footer>
        </>
    )
}
export default Footer;
